import type { PropsWithChildren } from "react";

type props = PropsWithChildren<{
    className: string,
    primary: string,
    secondary: string,
}>
const  Card: React.FC<props> = ({className, children, primary, secondary}) => {
    const classes = "card " + className + " " + primary + " hover:" + secondary + " bg-slate-50";

    return (
        <div className={classes}>
            {children}
        </div>
    );
}

export default Card;
